import React, { Component } from "react";

import NavBar from "./navBar";
import ShoppingCart from "./shopingCart";

class App extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <ShoppingCart />
      </React.Fragment>
    );
  }
}

export default App;
